import React, {Component} from 'react';
import CardUi from "./CardUi";
import './CardUiMain.css'
import image1 from '../../images/HandWash.jpg'
import image2 from '../../images/survey.jpg'
import image3 from '../../images/World Map.jpg'
const p1=[
    "Protect yourself and others from COVID-19",<br/>,
    "Regularly and thoroughly clean your hands with an alcohol-based hand rub or wash them with soap and water.",<br/>,
    "Maintain at least 1 metre (3 feet) distance between yourself and others."

]
const p2=[
    "Are you infected?",<br/>,
    "Here are some queries about the major symptoms of coronavirus.",<br/>,
    "By answering the questions you will be able to know about your health condition.",<br/>,
    "During the pandemic situation this process is very safe."
]
const p3=[
    "World Live Stats will provides informations about coronavirus real time update",<br/>,
    "You can see the active cases, De"
]


class CardUiMain extends Component {
    render() {
        return (
                <div className="container-fluid d-flex justify-content-center">
                    <div className="row">
                        <div className="col-md-4">
                            <CardUi imgsrc={image1} title="Health Trips" p={p1} url="/trips"/>
                        </div>
                        <div className="col-md-4">
                            <CardUi imgsrc={image2} title="Diagnose your chances of getting infected" p={p2} url="/survey"/>
                        </div>
                        <div className="col-md-4">
                            <CardUi imgsrc={image3} title="World Live States" p={p3} url="/stats"/>
                        </div>


                    </div>
                </div>
        );
    }
}

export default CardUiMain;
